import { Injectable } from '@angular/core';
import { Observable, of, throwError } from 'rxjs';
import { HttpClient, HttpHeaders, HttpErrorResponse } from '@angular/common/http';
import { catchError, tap, map } from 'rxjs/operators';

import * as pdfmake from 'pdfmake/build/pdfmake';
import * as pdfFonts from 'pdfmake/build/vfs_fonts';

const httpOptions = {
  headers: new HttpHeaders({
    'Content-Type': 'application/json',
    'Accept': 'application/json',
    'Access-Control-Allow-Origin': '*',
    'Access-Control-Allow-Methods': 'POST, GET, OPTIONS, PUT'
  })
};
const apiUrl = "http://7a984568.ngrok.io/api/";

@Injectable({
  providedIn: 'root'
})
export class RestService {

  constructor(
    private http: HttpClient
  ) {

  }

  getClassroom(): Observable<any> {
    return this.http.get(apiUrl, httpOptions).pipe(
      map(this.extractData),
      catchError(this.handleError));
  }

  getAtletaById(id: string): Observable<any> {
    const url = `${apiUrl}atletas/${id}`;
    return this.http.get(url/*, httpOptions*/).pipe(
      map(this.extractData),
      catchError(this.handleError));
  }

  postAtleta(data): Observable<any> {
    let api = 'nombres=' + data.nombres + '&apellidos=' + data.apellidos + '&dpi=' + data.dpi + '&genero=' + data.genero + '&telefono=' + data.telefono + '&fecha_nacimiento=' + data.fecha_nacimiento + '&email=' + data.email + '&descripcion=' + data.descripcion + '&id_categoria=' + data.id_categoria + '&pais=' + data.pais + '&direccion=' + data.direccion + '&numero=' + data.numero;
    const url = `${apiUrl}Registro?${api}`;
    return this.http.get(url).pipe(
      map(this.extractData),
      catchError(this.handleError));
  }
  putAtleta(data): Observable<any> {
    let api = 'nombres=' + data.nombres + '&apellidos=' + data.apellidos + '&dpi=' + data.dpi + '&genero=' + data.genero + '&telefono=' + data.telefono + '&fecha_nacimiento=' + data.fecha_nacimiento + '&email=' + data.email + '&descripcion=' + data.descripcion + '&id_categoria=' + data.id_categoria + '&pais=' + data.pais + '&direccion=' + data.direccion + '&numero=' + data.numero + '&id=' + data.id;
    const url = `${apiUrl}atletas/${data.id}`;
    return this.http.put(url, data).pipe(
      map(this.extractData),
      catchError(this.handleError));
  }
  updateClassroom(id: string, data): Observable<any> {
    const url = `${apiUrl}/${id}`;
    return this.http.put(url, data, httpOptions)
      .pipe(
        catchError(this.handleError)
      );
  }

  deleteAtleta(id: string): Observable<{}> {
    const url = `${apiUrl}/${id}`;
    return this.http.delete(url, httpOptions)
      .pipe(
        catchError(this.handleError)
      );
  }

  getCategorias(): Observable<any> {
    const url = `${apiUrl}categorias/`;
    return this.http.get(url).pipe(
      map(this.extractData),
      catchError(this.handleError));
  }

  getCompeticion(): Observable<any> {
    const url = `${apiUrl}competicion/`;
    return this.http.get(url).pipe(
      map(this.extractData),
      catchError(this.handleError));
  }

  getAtletas(): Observable<any> {
    const url = `${apiUrl}atletas/`;
    return this.http.get(url).pipe(
      map(this.extractData),
      catchError(this.handleError));
  }

  getReporte(): Observable<any> {
    const url = `${apiUrl}AtletasCategoria`;
    return this.http.get(url).pipe(
      map(this.extractData),
      catchError(this.handleError));
  }

  getAtletasCategoria(idCategoria): Observable<any> {
    const url = `${apiUrl}ByCategoria/${idCategoria}`;
    return this.http.get(url).pipe(
      map(this.extractData),
      catchError(this.handleError));
  }
  makePdf(atletas, categoria) {
    pdfmake.vfs = pdfFonts.pdfMake.vfs;
    var atletasA = [
      ['No. Atleta','Nombre', 'Direccion', 'Fecha de Nacimiento']
    ];
    var totalAtletas = 0;
    for(var i in atletas){
      var dateBorn = atletas[i].fecha_nacimiento.split('-');
      var atleta = [
        atletas[i].numero,
        atletas[i].nombres+' '+atletas[i].apellidos,
        atletas[i].direccion,
        dateBorn[2]+'-'+dateBorn[1]+'-'+dateBorn[0],
      ]
      atletasA.push(atleta);
      totalAtletas++;
    }

    var docDefinition = {
      content: [
        {
          columns: [
            {
              image: 'data:image/jpeg;base64,',
              fit: [100, 100]
            },
            [
              { text: 'UNIVERSIDAD MARIANO GALVES DE GUATEMALA', style: 'header' },
              { text: 'INGENIERIA EN SISTEMAS', style: 'sub_header' },
              { text: totalAtletas+' ATLETAS INSCRITOS EN '+categoria, style: 'url' },
            ]
          ]
        },
        
        {
          table: {
            // headers are automatically repeated if the table spans over multiple pages
            // you can declare how many rows should be treated as headers
            headerRows: 1,
            widths: [ 'auto', '*', '*', 'auto' ],
            //widths: [ '*', 'auto', 100, '*' ],
            body: atletasA
          }
        }
      ],
      
      styles: {
        header: {
          bold: true,
          fontSize: 17,
          alignment: 'right'
        },
        sub_header: {
          fontSize: 14,
          alignment: 'right'
        },
        url: {
          fontSize: 12,
          alignment: 'right'
        }
      },
      pageSize: 'LETTER',
      pageOrientation: 'portrait'
    };
    pdfmake.createPdf(docDefinition).download(categoria+'.pdf');
  }

  private handleError(error: HttpErrorResponse) {
    if (error.error instanceof ErrorEvent) {
      // A client-side or network error occurred. Handle it accordingly.
      console.error('An error occurred:', error.error.message);
    } else {
      // The backend returned an unsuccessful response code.
      // The response body may contain clues as to what went wrong,
      console.error(
        `Backend returned code ${error.status}, ` +
        `body was: ${error.error}`);
    }
    // return an observable with a user-facing error message
    return throwError('Something bad happened; please try again later.');
  }

  private extractData(res: Response) {
    let body = res;
    return body || {};
  }
}
